dynamic.code:
switch($box_msg.status)
{
    case BOX_IDLE: return $picture_ctrl.history_idle;
    case BOX_USED: return $picture_ctrl.history_used;
    case BOX_LOCK: return $picture_ctrl.history_lock;
    default : return $picture_ctrl.box_err;
}

switch($box_msg.type)
{
    case BOX_TYPE_MIN: return $picture_ctrl.box_min;
    case BOX_TYPE_MID: return $picture_ctrl.box_mid;
    case BOX_TYPE_MAX: return $picture_ctrl.box_max;
    default : return $picture_ctrl.box_err;
}

events.event:
u8 index;
HISTORY_MSG history_msg;
index = $picture_ctrl.history_detail_index;
if(1 == read_history_info(index , &history_msg))
{
    $box_msg.type = history_msg.box_info.type;
    $box_msg.status = history_msg.box_info.status;
    memcpy($box_msg.virtualnumber , history_msg.box_info.virtualnumber , VIRTUAL_NUM_LENGTH);

    memcpy($box_msg.user_id,history_msg.box_info.user_id,USERID_LENGTH);
    memcpy($box_msg.user_phnum,history_msg.box_info.user_phnum,USER_PHNUM_LENGTH);

    memcpy($box_msg.send_num,history_msg.box_info.send_num,SEND_NUM_LENGTH);
    memcpy($box_msg.send_id,history_msg.box_info.send_id,SENDID_LENGTH);
    memcpy($box_msg.timestr , datetime2str(history_msg.data_time)+5 , 11);//不显示年
}
